(5, 2045, 2042, 868, 'Товар б/у, гарантий и возвратов нет. Состояние на фото.'),
(5, 2045, 2042, 869, 'Товар б/у, ВОЗВРАТА И ГАРАНТИЙ - НЕТ.'),
(5, 2045, 2043, 868, 'Отправляем по полной предоплате. Оплачивая товар вы подтверждаете ваше согласие с условиями сделки. Гарантия что вас не кинут и качества товара - рейтинг http://baza.drom.ru/user/wheels70/feedbacks?role=buyer . Товар б/у, имеет следы эксплуатации. Все шины осмотрены визуально, все найденные дефекты отражены на фото. После отправки выкладываем фото накладной. С людьми не понимающими отличие б/у от нового товара - не работаем. '),
(5, 2045, 2043, 869, 'Товар б/у, ВОЗВРАТА И ГАРАНТИЙ - НЕТ.'),
(5, 2046, 2042, 868, 'Гарантия отсутствия грыж и сквозных порезов. Иных гарантий, а так же возвратов - нет. Возврата по причине неверного выбора размера и т.п. - НЕТ!\n\n1. Для местных - осмотр на месте, проверка на шиномонтаже ул. Мокрушина 9 за ваш счет, с учетом разумных затрат моего времени. Товар б/у, может иметь следы эксплуатации, существенно отличаться от нового. При сохранении возможности использования, претензии не принимаются. \n2. Для регионов - высылаем только по предоплате. Гарантия, что вас не кинут и соответствия качества - наш рейтинг http://baza.drom.ru/user/wheels70/feedbacks?role=buyer а так же большое количество продаваемых лотов. После отправки получаете фото накладной.\n\nСостояние товара на фото. Без предоплаты доп. фото не делаю. С людьми не понимающими отличие б/у от нового товара - не работаем. \nВ подтверждение качества - наша репутация и рейтинг http://baza.drom.ru/user/wheels70/feedbacks?role=buyer'),
(5, 2046, 2042, 869, 'Товар б/у, осмотр на месте, проверка на ближайшем шиномонтаже, ВОЗВРАТА И ГАРАНТИЙ - НЕТ.'),
(5, 2046, 2043, 868, 'Гарантия отсутствия грыж и сквозных порезов. Иных гарантий, а так же возвратов - нет. Возврата по причине неверного выбора размера и т.п. - НЕТ!\n\n1. Для местных - осмотр на месте, проверка на шиномонтаже ул. Мокрушина 9 за ваш счет, с учетом разумных затрат моего времени. Товар б/у, может иметь следы эксплуатации, существенно отличаться от нового. При сохранении возможности использования, претензии не принимаются. \n2. Для регионов - высылаем только по предоплате. Гарантия, что вас не кинут и соответствия качества - наш рейтинг http://baza.drom.ru/user/wheels70/feedbacks?role=buyer а так же большое количество продаваемых лотов. После отправки получаете фото накладной.\n\nШины проверены на наличие грыж, шишек и порезов в надутом состоянии. Остальное видно на фото. Без предоплаты доп. фото не делаю. С людьми не понимающими отличие б/у от нового товара - не работаем. \nВ подтверждение качества - наша репутация и рейтинг http://baza.drom.ru/user/wheels70/feedbacks?role=buyer'),
(5, 2046, 2043, 869, 'Товар б/у, осмотр на месте, проверка на ближайшем шиномонтаже, ВОЗВРАТА И ГАРАНТИЙ - НЕТ.'),
