(29, 2045, 2042, 'Адрес самовывоза уточняйте по телефону!  Доставка до города размещения объявления включена в цену.  Могу отправить в любой город Транспортными компаниями. Способы оплаты: наличными, карта сбербанк, альфабанк'),
(29, 2045, 2043, 'Товар находится в г. [+ATTR=27+]. Доставка до города размещения объявления включена в цену. При бесплатной доставке выбор тк остается за нами. Сроки отправки товара при бесплатной доставке составляют до 4 дней. наличными, карта сбер, альфабанк'),
(29, 2046, 2042, 'Самовывоз г. Томск, район пл. Южной, ТОЛЬКО по предварительной договоренности по телефону.\nПо предоплате могу доставить по г. Томску\nОтправляю в регионы любой ТК на ваш выбор\nПредлагается: ПЭК, РАТЭК, Деловые линии, Желдорэкспедиция, Автотрейдинг, Кит, Энергия. \nСтоимость доставки до тк и оформления документов на отправку 300р. за 2 или 4 шины. \nСтоимость упаковки дисков в картон, доставки до тк и оформления документов 400р. за 4 диска.\n\nСтоимость и сроки доставки до вашего города узнавайте на сайте ТК \n1. Выбираете тк\n2. Вводите название тк в гугл\n3. Переходите на сайте в раздел \\"калькулятор\\". \nПриблизительные параметры комплекта резины: 0,35м2 - 45кг.\nПриблизительные параметры комплекта дисков: 0,22м2 - 45кг.\nПриблизительные параметры комплекта колес: 0,4м2 - 85кг.\n\nСпособы оплаты:\nналичными, карта сбербанк, альфабанк'),
(29, 2046, 2043, 'Самовывоз г. Томск, район пл. Южной, ТОЛЬКО по предварительной договоренности по телефону.\nПо предоплате могу доставить по г. Томску\nОтправляю в регионы любой ТК на ваш выбор\nПредлагается: ПЭК, РАТЭК, Деловые линии, Желдорэкспедиция, Автотрейдинг, Кит, Энергия. \nСтоимость доставки до тк и оформления документов на отправку 300р. за 2 или 4 шины. \nСтоимость упаковки дисков в картон, доставки до тк и оформления документов 400р. за 4 диска.\n\nСтоимость и сроки доставки до вашего города узнавайте на сайте ТК \n1. Выбираете тк\n2. Вводите название тк в гугл\n3. Переходите на сайте в раздел \\"калькулятор\\". \nПриблизительные параметры комплекта резины: 0,35м2 - 45кг.\nПриблизительные параметры комплекта дисков: 0,22м2 - 45кг.\nПриблизительные параметры комплекта колес: 0,4м2 - 85кг.\n\nСпособы оплаты:\nналичными, карта сбербанк, альфабанк'),
