('av_tire_title', 'Новое поступление из Японии,Из Японии,Новое поступление,Распродажа'),
('disc_params', 'Количество дисков: [+ATTR=28+] шт.`(strlen("[+ATTR=6+]")>1)?("\\nПроизводитель: [+ATTR=6+]"):(" ")` \r\nДиаметр: [+ATTR=9+]\r\nСверловка: [+ATTR=5+]\r\nШирина: [+ATTR=31+]`("[+ATTR=32+]"==0)?(""):("\\nВылет: [+ATTR=32+]")``("[+ATTR=33+]"==0)?(""):("\\nЦО: [+ATTR=33+]")``("[+ATTR=34+]"==0)?(""):("\\nВес: [+ATTR=34+]")``(strlen("[+ATTR=11+]")>1)?("\\nMade in: [+ATTR=11+]"):("")` `(strlen("[+ATTR=35+]")>1)?("\\nОписание: [+ATTR=35+]"):("")`'),
('dlvry_cost', '(([+TABLE=8+]*250*[+ATTR=42+])<[+TABLE=36+])?([+TABLE=36+]):([+TABLE=8+]*250*[+ATTR=42+])'),
('dlvr_0', 'Товар находится в г. [+ATTR=27+]. Доставка до города размещения объявления включена в цену. При бесплатной доставке выбор тк остается за нами. Сроки отправки товара при бесплатной доставке составляют до 4 дней. наличными, карта сбер, альфабанк'),
('dlvr_1', '`([+ATTR=36+]==1||[+ATTR=36+]==2)?("Наличные, перевод на карту\r\nМогу отправить в любой город транспортной компанией. Доставка до склада тк ПЭК в нашем городе включена в цену (для дисков включена упаковка в картон).\r\nОтправка другими тк обсуждается индивидуально. \r\n"):("Самовывоз, г. [+ATTR=27+]\r\nНаличные, перевод на карту\r\nМогу отправить в любой город транспортной компанией.\r\nСтоимость доставки до тк и оформления документов на отправку [+LIST=19+]р. за 2 или 4 шины. \r\nСтоимость упаковки дисков в картон, доставки до тк и оформления документов [+LIST=19+]р. за 4 диска.\r\n\r\nСтоимость и сроки доставки до вашего города узнавайте на сайте ТК \r\n1. Выбираете тк\r\n2. Вводите название тк в гугл\r\n3. Переходите на сайте в раздел \\"калькулятор\\". \r\nПриблизительные параметры комплекта резины: 0,35м2 - 45кг.\r\nПриблизительные параметры комплекта дисков: 0,22м2 - 45кг.\r\nПриблизительные параметры комплекта колес: 0,4м2 - 85кг.")`'),
('drom_tx_disc_other', '("[+ATTR=38+]"=="[+ATTR=27+]")?(""):((("[+ATTR=38+]"!="[+ATTR=27+]")&&([+LIST=34+]==0))?("\r\nОтправка до склада ТК в город размещения объявления за мой счет. Могу отправить любой транспортной компанией в любой город за ваш счет."):("\r\nЦена указана с учетом доставки на наш склад в г. [+ATTR=38+]. Могу отправить любой транспортной компанией в любой город за ваш счет."))'),
('drom_tx_disc_w70', '([+LIST=33+]==1)?("\r\nЦена указана с учетом доставки на наш склад в г. [+ATTR=38+]. Могу отправить любой транспортной компанией в любой город за ваш счет. "):("\r\nОтправлю любой транспортной компанией в любой город за ваш счет. ")'),
